import './App.css';

import React from 'react';
import styled from 'styled-components';

const Button = styled.button`
  border-radius: 3px;
  padding: 0.25em 1em;
  margin: 0 1em;
  background: transparent;
  color: palevioletred;
  border: 2px solid palevioletred;
`;

const App = () => (
  <div>
    Welcome to Razzle. <Button onClick={() => console.log('clicked')}>StyledComponent button</Button>
  </div>
);

export default App;
